      | 353042 -> { ItemTypeData.id= 353042; name= "[TEST] Swarm Launcher"; published= false; description= "A mid-range anti-material weapon, the shoulder-mounted rocket launcher provides infantry squads with the means to effectively engage armored vehicles and installation gun emplacements. With pre-launch lock-on capabilities and intelligent swarm missiles, it is a man-portable system able to deliver devastating payloads against material targets.   Key to its success is the swarm missile technology. Fired in salvos, each warhead is fitted with an onboard guidance controller, which introduces random deviations and unpredictable patterns into the swarm's flight path, allowing some, if not all, missiles in the salvo to defeat basic countermeasure systems."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 353139 -> { ItemTypeData.id= 353139; name= "'Spitfire' Six Kin Submachine Gun"; published= false; description= "Favoring function over form, the SMG is a lightweight, semi-automatic weapon designed for close-quarters combat. What it lacks in stopping power and accuracy it grossly overcompensates for with quantity. Designed to injure and impede, the hailstorm of bullets the SMG produces is most effective in tight spaces against multiple targets.  This original design is a paradigm of Minmatar construction. An inelegant, but reliable weapon solution that is simple to produce, easily repaired using almost any available materials, and provides comparable pound-for-pound performance with similar sub-automatic weapons. Although an unabashedly low-tech weapon, it excels at what it was designed for: killing anything right in front of you."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 353236 -> { ItemTypeData.id= 353236; name= "Core Repair Tool"; published= false; description= "By projecting a focused harmonic beam into damaged materials, the repair tool channels construction nanites to return the targeted matter to its original state. Its on-board processor interfaces with a forward-facing sensor suite, instantly recognizing vehicles, devices, and personal armor based on microscopic manufacturer's tags. The beam, a bi-channel “hollow laser”, simultaneously acts as both a containment field and transport medium for the nanite swarm, which works to sift unwanted particles from the structure, undo ionization, and reconstruct the atomic patterns of the material.  The repair tool has several design innovations, the most surprising probably being the incorporation of Amarr focusing crystal technology. Beyond that, the device also makes use of an advanced K7 nano static co-processor on par with Caldari planet side missile tracking systems and a 55x5 reverse current power cell configuration rarely used beyond self-sustaining Gallente drone units. The result is an elegant tool combining the best technology from several very different design philosophies."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
