      | 365652 -> { ItemTypeData.id= 365652; name= "'Pyrus' Allotek Assault Rifle"; published= false; description= "Utilizing sub-licensed technology sourced from all across the cluster, Allotek Industries’ Pyrus product line offers a wide range of dropsuit and weapon variants developed and manufactured in accordance with the corporation’s stringent guidelines to ensure that all products are worthy of carrying the Allotek quality guarantee."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 365943 -> { ItemTypeData.id= 365943; name= "'Praetorian VII' Madrugar"; published= false; description= "NOTE: In addition to pre-requisite skills, this pre-fitted vehicle requires PG/CPU optimization skills to be trained in order to be used.    The Heavy Attack Vehicle (HAV) serves as an anchoring unit for many planetary engagements, fulfilling its role as a long-range and heavily armored unit. Equipped with thick and resilient armor plating and high-capacity shielding systems, it is a tenacious defensive vehicle, able to withstand persistent onslaughts from entrenched enemies. "; marketGroupId= None; groupId= 351210; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366234 -> { ItemTypeData.id= 366234; name= "Faction Booster Amarr (90-Day)"; published= false; description= "Faction boosters are biometric identification chips issued by major factions throughout New Eden. Once activated they uniquely identify the user as a supporter of the issuing faction. Corporations operating on behalf of the faction will then be authorized to increase rewards to that individual."; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 366428 -> { ItemTypeData.id= 366428; name= "Imperial Carthum Assault Scrambler Rifle"; published= false; description= "The scrambler rifle is a selective-fire weapon capable of semi-automatic and charged fire. Each shot produces a pulse of sinuous energy capable of penetrating shield and metal. By keeping pressure on the trigger, the operator can control the power of each discharge, scaling it to produce an intense pulse of energy fatal to soft targets.    The added power output does come with downsides, most notably increased heat build-up; left unmanaged, thermal stresses age the focusing crystal prematurely, resulting in splintering and potentially lethal feedback. Despite this and several other issues – increased heft, poor reliability, and high manufacturing cost – the scrambler rifle is widely available and in service on battlefields clusterwide."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366525 -> { ItemTypeData.id= 366525; name= "State Nanite Injector"; published= false; description= "The nanite injector delivers an active helix directly into the bloodstream of the downed victim, whereupon individual subunits work to suppress the pain response, repair tissue and organ damage and reestablish regular cardiac rhythm. If administered in time, first-phase resuscitation (defined as ‘minimum-essential combat functionality') is typically achievable, though some psychological trauma is to be expected."; marketGroupId= None; groupId= 351844; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 366719 -> { ItemTypeData.id= 366719; name= "'Neo' Commando G-I"; published= false; description= "The Commando dropsuit is a variable combat unit capable of reacting to battlefield threats as they emerge. Built using a repurposed heavy frame, the suit is designed for maximum offensive flexibility. The streamlined frame does away with extraneous armor layers, using the augmented power of the exoskeleton to instead shoulder the weight and bulk of two light-class weapons.    Modified to better interface with light-class blaster weaponry, the Gallente Commando’s subframe regulates the weapon’s cyclotron output, improving plasma compression and enhancing the magnetic acceleration of the produced discharge with devastating results.    The Commando is the ultimate suppression fighter. What the suit sacrifices in tactical versatility, it more than makes up for with flexible weapon loadouts that can counter any of the myriad threats an ever-evolving battlefield may present."; marketGroupId= None; groupId= 351064; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
