      | 367592 -> { ItemTypeData.id= 367592; name= "Militia Magsec SMG Blueprint"; published= false; description= "The magsec is a semi-automatic firearm capable of sustained, accurate fire at ranges beyond what conventional sidearms can offer. A high-speed slider feeds current to a magazine of hyper velocity projectiles that are discharged with minimal separation, maximizing energy efficiency and reducing flux shear to produce a weapon with lethal kinetic potential.     Having overcome early reliability issues, manufacturers  have since taken advantage of the weapon’s modular design; the magsec has been made available in multiple combat configurations – including optical sights and silenced operation – and is in widespread service throughout the cluster."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
      | 367689 -> { ItemTypeData.id= 367689; name= "APEX 'Nomad' Assault"; published= false; description= "The Assault dropsuit is a versatile frontline combat suit that combines excellent protection, good mobility, and sufficient hard points for mission-specific customizations.  Native Minmatar tech favors straightforward solutions, a consequence of the fledgling Nation’s indigent past. Stripped of the haptic bindings and sensor technology of the Logistics suit, the Assault variant is a lightweight, low-power solution that utilizes a combination of shielding and resistive plating to thwart enemy fire. Its slimline hydraulic assisted exoskeleton enhances movement speed and user strength, while hard shell reactive armor protects the wearer from a wide-range of small arms ballistics. A mimetic recycler stores and reroutes excess power as needed.  Assault dropsuits are intended for standard combat operations or those in which the objectives are likely to change at a moment’s notice. Its ability to carry anything from small arms and explosives to anti-vehicle munitions and deployable support gear makes it the most adaptable direct combat suit on the battlefield."; marketGroupId= None; groupId= 367594; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
