      | 53021 -> { ItemTypeData.id= 53021; name= "Bhaalgorn Malagrin Marshlight SKIN"; published= true; description= "The vast low-lying deltas and marshy plains of Luminaire's Western Morthane region have a long and dark history in folklore and in the ancient warring states period of the Gallente home world's past. Inhabitants on the periphery of the Great Morthani Wastes have many legends of spirits of light and flame seen wandering the swamps and several of these are feared as devils and demonic beings.    The Western Morthani natives called the most-feared of these spirits the  Boitata , and believed it to be a fiery serpent with a penchant for consuming the eyes of the dead and perhaps even the sinful living. Garouni settlers on the far western edge of the Great Wastes called this legendary demon  Malagrin  and also noted the tendency for livestock drowned in the marshes to attract these eery lights.    Military disaster is also a feature of the history of the Great Morthani Wastes. In its epic campaign to overthrow the ancient slaveholder Empire of Morthane, the Garoun Empire made several attempts to bypass the blistering deserts of Southern Morthane by marching armies through the western swamps. The legions of Garoun failed to penetrate the grim marshlands at every try, giving up on the route after an entire army, wracked by disease and starvation was destroyed by Morthani raiders at the south-eastern edge of the great wastes.    Some tales are told of lights dancing on the corpses of the lost soldiers of Garoun and this has become part of the Malagrin and Boitata legends on either side of the vast swamps."; marketGroupId= Some(1963); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
